import React from 'react'

const ShowFriend = ({UserData, ListFriend}) => {
    
    console.log(ListFriend)

    return (
        <div>
            {
                ListFriend.map((friend)=>(
                    <div>
                        <img src={friend.image} />
                        <div>
                            <div>{friend.userName}</div>
                            <div>{friend.message}</div>
                        </div>
                    </div>
                ))
            }
        </div>
    )
}

export default ShowFriend
